import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
import QuoteCard from "./components/QuoteCard";

function App() {
  const [simpson, setSimpson] = useState([]);
  console.log(simpson);

  const sampleQuote = {
    quote: "That's where I saw the leprechaun...He told me to burn things.",
    character: "Ralph Wiggum",
    image:
      "https://cdn.glitch.com/3c3ffadc-3406-4440-bb95-d40ec8fcde72%2FRalphWiggum.png?1497567511523",
  };

  useEffect(() => {
    axios
      .get("https://simpsons-quotes-api.herokuapp.com/quotes")
      .then((res) => setSimpson(res.data[0]));
  }, []);

  return (
    <div>
      <QuoteCard sampleQuote={sampleQuote} />
    </div>
  );
}

export default App;
